import React from "react";
import styled from "styled-components";

function Nav() {
  return (
    <React.Fragment>
      <NavContainer>
        <h1>Logo</h1>
        <MenuItemsContainer>
          <nav>
            <ul>Item 1</ul>
            <ul>Item 2</ul>
            <ul>Item 3</ul>
          </nav>
        </MenuItemsContainer>
      </NavContainer>
    </React.Fragment>
  );
}

export default Nav;
const NavContainer = styled.div`
  display: flex;
  justify-content: space-evenly;
  align-items: center;
`;

